import React from 'react'
import menuClose from '../images/header/menuClose.png'
const Menu = () => {
	return (
		<div className='menu'>
			<img src={menuClose} className='menuClose'></img>
			<div className='menuItems'></div>
		</div>
	)
}

export default Menu
